  false,\n\t\"url\": null,\n\t\"notes\": \"This report presents the results of a goose
  production study at Fish Springs National Wildlife Refuge. The objectives of this
  study were; 1) determine the reproductive success of the breeding population including
  average clutch and brood size, total hatched and fledged, and 2) evaluate the breeding
  goose population in relation 1989 and 1990  production, population growth, nest
  site selection and drawdown response.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
